import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div class='Parentbox'>
      <div class='Kopimahal'>
        <h1>Kelompok PABW Kopi Mahal</h1>
      </div>
      <div class='Garis'></div>
      <div class="Link-halaman">
        <h1>Pilih Halaman</h1>
        <table>
          <tr><a href='pages/tampilXml.js'>halaman csv</a></tr>
          <tr><a href='https://www.petanikode.com/contact.html'>halaman xml</a></tr>
          <tr><a href='https://www.petanikode.com/contact.html'>halaman json</a></tr>
        </table>
      </div>

    </div>
  );
}

export default App;
